import React, { Component } from 'react';

const serv = ['A/C Replacement', 'Heating Replacement', 'Standard Testing'];

class Services extends Component {
	renderContent() {
		return (
			serv.map((s) => {
				<li>{s}</li>
			})
		);
	}
	render() {
        return (
            <div id="main">
				<div id="content">
					<section>
						<div className="container">
							<ul>{this.renderContent()}</ul>
						</div>
					</section>
				</div>
			</div>
        );
    }
}

export default Services;
